@user @user Exato. A oposição não percebe que não votamos em um PR que tinha um plano ilusório de governo, mas sim num plano de governo realista e eficaz, sustentado pelo povo.
O plano deste atual governo pertence ao povo.
Por isso se levantar contra esse governo é se levantar contra o povo.

3 lições para a vida: 

1. Se ame, se valorize, se não fizer isso ninguém vai te valorizar;
2. Seja honesto contigo mesmo, é necessário aceitar as mudanças que a vida traz;
3. Seja grato até pelos momentos ruins, afinal são eles que te fazem mais forte;

